import { BrowserRouter, Route, Routes } from "react-router-dom"
import Header from "./componat2/Header"
// import Slider from "./componat2/Slider"
import About from "./componat2/About"

function App(){
    return(
<div>

<Header/>
<BrowserRouter>
<Routes>
{/* <Route path="/Home" element={<Slider/>}></Route> */}
<Route path="/About" element={<About/>}></Route>
</Routes>
</BrowserRouter>
</div>
    )
}
export default App
